package com.symantec.vip.automation.eg.pages;import java.util.List;import java.util.concurrent.TimeUnit;import org.openqa.selenium.By;import org.openqa.selenium.WebDriver;import org.openqa.selenium.WebElement;import org.openqa.selenium.support.FindBy;import org.openqa.selenium.support.How;public class ImportSettingsPage extends Page {	@FindBy(how = How.CLASS_NAME, using = "errortext")	public WebElement Error_label;	@FindBy(how = How.ID, using = "filePassword")	public WebElement Password_Field;	@FindBy(how = How.LINK_TEXT, using = "Settings")	public WebElement Tab_Settings;	@FindBy(how = How.LINK_TEXT, using = "Import Settings")	public WebElement Link_ImportSettings;	@FindBy(how = How.XPATH, using = "//input[@value='Import']")	public WebElement Import_Button;	@FindBy(how = How.XPATH, using = "//input[@value='Back']")	public WebElement Back_button;	@FindBy(how = How.XPATH, using = ".//*[@id='mainBody']/div[2]")	public WebElement Success_Message;	@FindBy(how = How.XPATH, using = "//input[@value='Finish']")	public WebElement Finish_button;	@FindBy(how = How.NAME, using = "exportedFile")	public WebElement BrowsePath_Field;	@FindBy(how = How.ID, using = "next")	public WebElement Next_Button;	@FindBy(how = How.ID, using = "version")	public WebElement Version_Label;	public ImportSettingsPage(WebDriver webDriver) {		super(webDriver);	}	public List<WebElement> Get_Webelements() {		driver.manage().timeouts().implicitlyWait(30, TimeUnit.SECONDS);		return driver.findElements(By.name("choices"));	}}